all_search: 'Rambo, William R. (William Ralph), 1916- William R. Rambo papers, 1939-1992
  (inclusive), 1954-1974 (bulk). 35 linear feet Materials are open for research use.
  Audio-visual materials are not available in original format and must be reformatted
  to a digital use copy. William R. Rambo received his B.A. and Electrical Engineering
  degrees from Stanford University in 1938 and 1941.  He was a research associate
  at the Harvard Radio Research Lab and a research engineer with Airborne Instruments
  Lab in New York before coming to Stanford as a research associate in 1951.  He was
  made a Professor of Electrical Engineering in 1957, Director of Electronics Labs
  in 1960, and Associate Dean of the School of Engineering in 1961.  He retired as
  a Professor Emeritus in 1972. These papers, kept in their original arrangement,
  reflect Prof. Rambo''s administrative responsibilities as well as his research interests,
  largely during his time at Stanford University.  Stanford subjects include the School
  of Engineering, the Electrical Engineering Department, the Stanford Electronic Labs,
  the Applied Electronics Lab, research policy at Stanford, courses, the Academic
  Senate, the University Land and Building Development Committee, and student demonstrations.  Other
  subjects include the American Society for Engineering Education, Engineering College
  Research Council, Joint Services Electronic Program, and Rambo''s research work
  with the U.S. Army, Air Force, and Navy. Gift of William R. Rambo, 1975, 1976, 1997.
  Special Collections and University Archives materials are stored offsite and must
  be paged 48 hours in advance. For more information on paging collections, see the
  department''s website: https://library.stanford.edu/libraries/special-collections.
  [identification of item] William R. Rambo Papers (SC0132). Department of Special
  Collections and University Archives, Stanford University Libraries, Stanford, Calif.
  While University Archives is the owner of the physical and/or digital items, permission
  to examine collection materials is not an authorization to publish. These materials
  are made available for use in research, teaching, and private study. Any transmission
  or reproduction beyond that allowed by fair use requires permission from the owners
  of rights, heir(s) or assigns. Rambo, William R. (William Ralph), 1916- Stanford
  University. School of Engineering. Stanford University. Department of Electrical
  Engineering Faculty. Stanford Electronics Laboratories. Stanford University Academic
  Council. Stanford University Faculty Senate. Stanford University Applied Electronics
  Laboratory. Stanford University Stanford Electronics Laboratories. Engineering Research.
